import React from "react";
import "./Footer.css";
function Footer() {
  return (
    <div className="footer_box">
      <div className="tag_box">
        <div className="team_name">
          <h4>팀명</h4>
          <span>아는게 없조</span>
        </div>
        <div className="abc">
          <h4>기수</h4>
          <span>BEB_01기</span>
        </div>
        <div className="team_member">
          <h4>팀원</h4>
          <span>안창남, 김대익, 유호진</span>
        </div>
      </div>
    </div>
  );
}

export default Footer;
